INSERT INTO `projects` (`id`, `title`, `description`, `upvote`, `status`, `amount`, `deadline`) VALUES (1,'Green Energy Initiative','A project to develop renewable energy sources in urban areas.',120,'Active',50000.00,'2024-12-31'),(2,'AI Research Lab','Research lab focused on artificial intelligence and machine learning.',250,'Completed',75000.00,'2023-11-15'),(3,'Community Garden','Establishing community gardens in local neighborhoods to promote healthy living.',75,'Active',15000.00,'2024-08-01'),(4,'Open Source Education','Creating open-source educational resources for underprivileged students.',180,'Pending',30000.00,'2024-10-15'),(5,'Wildlife Conservation','Protecting endangered species through habitat preservation and awareness campaigns.',220,'Active',45000.00,'2024-05-20'),(6,'Tech Innovation Hub','A hub for startups and innovators to collaborate and create new technologies.',95,'Completed',60000.00,'2023-09-01'),(7,'Water Purification System','Developing affordable water purification systems for rural areas.',140,'Active',20000.00,'2024-07-30'),(8,'Cultural Festival','Organizing an annual festival to celebrate cultural diversity.',160,'Pending',25000.00,'2024-11-10'),(9,'Smart City Project','Implementing smart city technologies to improve urban living.',190,'Active',85000.00,'2024-12-01'),(10,'Digital Literacy Program','Providing digital literacy training to adults in underserved communities.',110,'Completed',10000.00,'2023-10-25');
